Idle_Members_Distrib_1.query:
q = load "${App.Datasets.TransactionJournal66.FullyQualifiedName}";
q = filter q by 'Status' == "Processed";
q = filter q by 'JournalType_Name' in ["Accrual", "Redemption"];
q = group q by 'MemberId';
q = foreach q generate toDate(max('ActivityDate_sec_epoch')) as 'ActivityDate', toString(toDate(max('ActivityDate_sec_epoch')), "yyyy") as 'ActivityDate_Year', toString(toDate(max('ActivityDate_sec_epoch')), "MM") as 'ActivityDate_Month', toString(toDate(max('ActivityDate_sec_epoch')), "dd") as 'ActivityDate_Day', first('LoyaltyProgramMember_EnrollmentDate') as 'LoyaltyProgramMember_EnrollmentDate', 'MemberId' as 'MemberId', first('Status') as 'Status';

q_2_and_3 = filter q by 'ActivityDate' in {{cell(Idle_Duration_1.selection, 0, "DateRange").asObject()}};
q_3 = filter q_2_and_3 by {{row(ActivityDate_1.selection, [0], ["min", "max"]).asDateRange("date('ActivityDate_Year','ActivityDate_Month','ActivityDate_Day')")}};
q_3 = foreach q_3 generate "No transactions during the inactive period but with transactions in the selected duration" as 'Category', 'MemberId';

q_2 = group q_2_and_3 by 'MemberId' left, q_3 by 'MemberId';
q_2 = foreach q_2 generate q_2_and_3.'MemberId' as 'MemberId', q_3.'MemberId' as 'Flag', "No transactions during the inactive period and the selected duration, but with transactions since membership began" as 'Category';
q_2 = filter q_2 by 'Flag' is null;
q_2 = group q_2 by 'Category';
q_2 = foreach q_2 generate 'Category', unique('MemberId') as 'unique_Members';

q_3 = group q_3 by 'Category';
q_3 = foreach q_3 generate 'Category', unique('MemberId') as 'unique_Members';

q_members = load "${App.Datasets.LoyaltyMemberTier66.FullyQualifiedName}";
q_members = filter q_members by 'LoyaltyProgramMember_TransactionJournal_FirstAccrualDate' is null;
q_members = group q_members by all;
q_1 = foreach q_members generate unique('LoyaltyMemberId') as 'unique_Members', "No transactions since membership began" as 'Category';

q_result = union q_1, q_2, q_3;
q_result = cogroup q_result by 'Category';
q_result = foreach q_result generate 'Category' as 'Category', (case when 'Category' == "No transactions since membership began" then sum('unique_Members') else 0 end) as 'No transactions since membership began', (case when 'Category' == "No transactions during the inactive period but with transactions in the selected duration" then sum('unique_Members') else 0 end) as 'No transactions during the inactive period but with transactions in the selected duration', (case when 'Category' == "No transactions during the inactive period and the selected duration, but with transactions since membership began" then sum('unique_Members') else 0 end) as 'No transactions during the inactive period and the selected duration, but with transactions since membership began';
 q_result = group q_result by 'Category';
 q_result = foreach q_result generate 'Category', sum(sum('No transactions since membership began')) over ([..] partition by all) as 'No transactions since membership began', sum(sum('No transactions during the inactive period but with transactions in the selected duration')) over ([..] partition by all) as 'No transactions during the inactive period but with transactions in the selected duration', sum(sum('No transactions during the inactive period and the selected duration, but with transactions since membership began')) over ([..] partition by all) as 'No transactions during the inactive period and the selected duration, but with transactions since membership began', sum('No transactions since membership began')+sum('No transactions during the inactive period but with transactions in the selected duration')+sum('No transactions during the inactive period and the selected duration, but with transactions since membership began') as 'unique_Members';

